(261, 'Housing & Regeneration', 'Housing', 'Affordable Housing', '', 'grant funding to lever private funding in Support of new build affordable housing. Grant is paid to Registered Providers which will contract for construction. ', '', 'Various', '', '', '', '01/01/2015', '', '1', '1', '31/12/2016', '', '', '0', 0.00, 0.00, 0.00, 0.00, 957.00, 957.00, 1914.00, 0.00, '', '', '', '', '', '', '', '', 'DCLG', '', '', 'Geographic location of spend will not be known until (a) the total resource has been assigned between the GLA settlement and HCA; and (b) GLA/HCA have conducted bidding rounds for registered providers. The leveraging of private finance means total construction expenditure by providers will be higher (whilst not all grant can be assigned to construction  and not all schemes will involve a new construction element). There remains potential for expenditure to be moved between years and programmes as SR outcomes are worked through: there should be an expectation that the pipeline return will change. Applicable spend for determining__savings will be considerably lower and has yet to be determined.'),
