(924, 'Transport', 'Rail', 'Crossrail', 'Crossrail', 'Crossrail will deliver a new high-frequency rail service and supporting infrastructure for London and the South East  with 13 miles of twin tunnels and eight new underground stations across central London.  Services will run from Maidenhead and Heathrow in the west to Shenfield in the east and Abbey Wood in the south east. The central tunnel will open in Dec 2018 with full services commencing in Dec 2019.', '', 'London', 'Public / private', 'No - but the current Network Rail sections over wh', 'Public / private', '2009', 'Confirmed', '4', '4', '2018  (Fully open late 2019)', 'Yes', '4', '4', 14500.00, 0.00, 1932.00, 2167.00, 2127.00, 6226.00, 3760.00, 2.00, 'Estimated', 'Nominal', '', '', '', '', 'Various given the wide range of contracts and vary', '', 'Crossrail Limited / Network Rail / Rail For London', '', 'Crossrail Investment Model', 'The ?14.5bn expected cost excludes rolling stock and depot contracts. '),
(925, 'Transport', 'Rail', 'High Speed Rail', 'National high speed rail network (phase one) - con', 'Line from London Euston to the West Midlands with new stations at Old Oak Common  Birmingham Interchange and Birmingham Curzon Street. Direct connections onto the West Coast Main Line for services to the NW and Scotland  and onto HS1 for services to the Continent. The design capability of the line would 250 miles per hour  but with an operating limit of 225 miles per hour at opening. ', '', 'Great Britain', 'Public', 'No', 'Public / private', '2017', 'Confirmed', '4', '4', '2026', 'Yes', '4', '4', 21374.00, 0.00, 366.90, 442.50, 980.00, 1789.40, 15219.00, 0.00, 'Estimated', 'Constant', '2010/11', '', '', '', '', '', '', '', 'Investing in Britain: //www.gov.uk/government/uplo', 'This project is subject  to Parliamentary approval and the passing of legislation'),
(926, 'Transport', 'Rail', 'High Speed Rail', 'National high speed rail network (phase two) - con', 'Separate lines from West Midlands to Leeds and Manchester  with intermediate stations in the East Midlands and South Yorkshire. Direct connections to Heathrow and onto the West and East Coast main lines for services to the NW  NE and Scotland.', '', 'Great Britain', 'Public', 'No', 'Public / private', '2022', 'Confirmed', '4', '4', '2032', 'Yes', '', '0', 21183.00, 0.00, 38.16, 70.15, 146.78, 255.09, 1267.00, 0.00, 'Estimated', 'Constant', '2010/11', '', '', '', '', '', '', '', 'Investing in Britain: //www.gov.uk/government/uplo', 'This project is subject  to Parliamentary approval and the passing of legislation'),
